  input: 'TEXT,F3XA,,"In response to the Commission''s preliminary review of the Mid
    Year Report (1/01/03 - 6/30/03), the beginning cash balance of the Mid Year Report
    should now reflect the ending balance of the 2002 Amended Year End Report.    We
    have updated the debts and obligations page to reflect our payment history on
    debts through 6/30/03.   We have amended our report to included the updates of
    information requested of our donors that had not previously disclosed their occupations
    and/or employer.  We believe  that we ahve established a ''best efforts'' procedure
    to  capture the information needed.  Every fundraising device includes the following
    language -   Paid for by the Republican Federal Committee of Pennsylvania.  The
    Federal Election Commission requires us to obtain the following information: Name,
    Address, City, State, Zip, Occupation, Title, Name of Firm, Home Tele, Business,
    Tele.  If the information is not provided at the time of donation, a letter requesting
    the follow-up information is sent from the committee, along with a postage-apid
    return envelope for easy return.    We are hoping that our response to your preliminary
    review is adequate.  Please feel free to contact us if further clarification is
    needed."'
